import React, {Component} from 'react';
import {Tabs,Tab, Grid, Cell, Card, CardText, CardActions, CardTitle, Button, IconButton, CardMenu} from "react-mdl";

class Aboutme extends Component {

    render(){
        return (
            <Card shadow={0} style={{width: '400px', margin: 'auto'}}>
    <CardTitle style={{color: '#fff', height: '500px', background: 'url(https://fi.pinterest.com/pin/521432463112543670/'}}>Welcome</CardTitle>
    <CardText>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
        Mauris sagittis pellentesque lacus eleifend lacinia...
    </CardText>
    <CardActions border>
        <Button colored>Get Started</Button>
    </CardActions>
    <CardMenu style={{color: '#fff'}}>
        <IconButton name="share" />
    </CardMenu>
</Card>

        )
    }
}

export default Aboutme;
